import styled from '@emotion/styled';
import React from 'react'

function Skills({skills}) {
    return (
        
        <Container>
            <Head>Languages and Libraries I have worked with</Head>
            <SKillsContainer>
            {skills.map((skill)=> {
                return <Skill src={`${skill}.png`}/>
            })}
            </SKillsContainer>
            
        </Container>
    )
}

export default Skills

const Container = styled.div`
grid-area: content;
height: 100%;
width: 100%;
background-color: white;
`;

const SKillsContainer = styled.div`
margin-top: 1rem;
display: flex;
flex-direction: row;
flex-wrap: wrap;
`;

const Skill = styled.img`
width: 10rem;
height: 10rem;
margin: auto;
border-radius: 1rem;
`;

const Head = styled.div`
display: block;
font-size: 1rem;

`;
